import React from 'react';

const OrderTracking = () => {
    return (
        <div className="p-4">
            <h1 className="text-2xl font-bold mb-4">Order Tracking</h1>
            <p>Your order is being prepared and will be delivered soon!</p>
        </div>
    );
};

export default OrderTracking;
